import './App.css';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import JoinRoomPage from './JoinRoomPage/JoinRoomPage';

const App = () => {
  return (  
    <Routes>
      <Switch>
          <Route path='/join-room' element={<JoinRoomPage />} />
      </Switch>
    </Routes>
  );
}

export default App;
